import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Systems } from './pages/Systems';
import { AnatomicalLocations } from './pages/AnatomicalLocations';
import { AnatomicalLocation } from './pages/AnatomicalLocation';
import { AddFolder } from './pages/AddFolder';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-[#f5f6f8]">
        <Routes>
          <Route path="/" element={<Systems />} />
          <Route path="/system/:systemId" element={<AnatomicalLocations />} />
          <Route path="/system/:systemId/location/:locationId" element={<AnatomicalLocation />} />
          <Route path="/add-folder/:type" element={<AddFolder />} />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
